import "bootstrap/dist/css/bootstrap.min.css";
import Card from "react-bootstrap/Card";
import './RepoCard.css'

function TopCard(){
    return(
        <Card id="topCard">
        <Card.Body className='text-center'>
            <Card.Title >These are my Top 12 most recently created repos </Card.Title>
            <Card.Subtitle>Have Fun!</Card.Subtitle>
        </Card.Body>
    </Card>
    )

}

export default TopCard;
